import React from "react";

import { Jumbotron } from 'react-bootstrap';

import Button from 'reactstrap';


const Home = () =>
{
    return(

        <div>


            <Jumbotron>


                <h1>
                    Home Page
                </h1>

                <p>

                    This is a simple Spring Boot back end course 
                </p>
            </Jumbotron>
        </div>
    );
}

export default Home;
